        imgSrc : '../../assets/profile/0.jpg',
        name : 'jack'
    },{
        imgSrc : '../../assets/profile/1.jpg',
        name : 'mary'
    }]
    return (
        friendInfo.map((item) => {
            return <Friend {...item}></Friend>
        })
    )
}
